        .price.price-old {
            position: relative;
            margin-left: 30px
        }
        
        .price.price-old:after {
            content: ' ';
            display: block;
            position: absolute;
            top: 50%;
            left: 50%;
            width: calc(100% + 20px);
            margin: 0;
            margin-left: calc(0px - 50% - 10px);
            margin-top: -1px;
            height: 2px;
            background: #333;
            border: 1px solid #fff;
            border-radius: 2px
        }
        
        .price.price-old.length-1:after {
            transform: rotate(-45deg);
            -webkit-transform: rotate(-45deg);
            -ms-transform: rotate(-45deg)
        }
        
        .price.price-old.length-2:after {
            transform: rotate(-45deg);
            -webkit-transform: rotate(-45deg);
            -ms-transform: rotate(-45deg)
        }
        
        .price.price-old.length-3:after {
            transform: rotate(-30deg);
            -webkit-transform: rotate(-30deg);
            -ms-transform: rotate(-30deg)
        }
        
        .price.price-old.length-4:after {
            transform: rotate(-30deg);
            -webkit-transform: rotate(-30deg);
            -ms-transform: rotate(-30deg)
        }
        
        .price.price-old.length-5:after {
            transform: rotate(-30deg);
            -webkit-transform: rotate(-30deg);
            -ms-transform: rotate(-30deg)
        }
        
        .price.price-old.length-6:after {
            transform: rotate(-20deg);
            -webkit-transform: rotate(-20deg);
            -ms-transform: rotate(-20deg)
        }
        
        .price.price-old.length-7:after {
            transform: rotate(-20deg);
            -webkit-transform: rotate(-20deg);
            -ms-transform: rotate(-20deg)
        }
        
        .price.price-old.length-8:after {
            transform: rotate(-15deg);
            -webkit-transform: rotate(-15deg);
            -ms-transform: rotate(-15deg);
            width: calc(100% + 16px);
            margin-left: calc(0px - 50% - 8px)
        }
        
        .price.price-old.length-9:after {
            transform: rotate(-15deg);
            -webkit-transform: rotate(-15deg);
            -ms-transform: rotate(-15deg);
            width: calc(100% + 16px);
            margin-left: calc(0px - 50% - 8px)
        }
        
        .price.price-old.length-10:after {
            transform: rotate(-10deg);
            -webkit-transform: rotate(-10deg);
            -ms-transform: rotate(-10deg);
            width: calc(100% + 16px);
            margin-left: calc(0px - 50% - 8px)
        }
        
