                    <p class="ms-text--small">50 yılı aşkın birikimiyle, 13 ülkede, 1000’den fazla mağazası ve 65 bini aşan çalışanı ile yıllık ortalama 2.1 milyar ziyaretçisine hizmet veren MediaMarkt-Saturn Perakende Grubu’na bağlı MediaMarkt, dünya markalarını Alman uzmanlığı
                        ve uygun fiyatlarla müşterilerine sunuyor. Kaliteli satış öncesi ve sonrası hizmet anlayışıyla müşterilerini ağırlayan Avrupa’nın 1 numaralı elektronik perakendecisi MediaMarkt, Türkiye’de ilk mağazasını 2007 Eylül ayında İstanbul
                        Ümraniye’de açtı. 2013 yılında da online satış kanalı mediamarkt.com.tr’yi hayata geçirdi. Uluslararası çok kanallı stratejisi ile mağazacılık ve online perakendeciliğin sayısız avantajlarını müşterilerine entegre olarak sunan
                        MediaMarkt’ın, Adana, Ankara, Antalya, Aydın, Balıkesir, Bodrum, Bursa, Çorlu, Çorum, Denizli, Edremit, Erzurum, Eskişehir, Gaziantep, İstanbul, İzmir, İzmit, Kayseri, Sakarya, Samsun, Malatya, Mersin, Konya, Kahramanmaraş, Şanlıurfa,
